#include <iostream>
    using std::cout;
    using std::endl;
#include <NTL/ZZ.h>
    using NTL::ZZ;



ZZ euclidesClasico(ZZ higher, ZZ lower);
ZZ moduloNTL(ZZ dividendo, ZZ divisor);

int main(){
    cout<<euclidesClasico(ZZ(),ZZ());
return 0;
}

ZZ euclidesClasico(ZZ higher, ZZ lower){
    ZZ r;

    while (lower != 0){
        r = moduloNTL(higher,lower);
        higher = lower;
        lower = r;
    }
    return higher;
}

ZZ moduloNTL(ZZ dividendo, ZZ divisor){
	ZZ cociente=dividendo/divisor;
	ZZ residuo=dividendo-(cociente*divisor);
	if(residuo<0){
		residuo=divisor+residuo;
		cociente-=1;
	}
	return residuo;
}
